import React from "react";
import { Link } from "react-router-dom";

const SignUp=()=>{
    return(
        <>
            <div>Sign Up</div>
            <div>
                <Link to='/Signup'>
                    <a>Don't have an account? Sign Up here...</a>
                </Link>
            </div>
        </>
    )
}

export default SignUp
